    const location=props.history.location.pathname;
    const listLoca =location.split('/');
    console.log(listLoca);
    return(
        <div className="banner3">
            <div className='banner3-title'>{props.title}</div>
            <div className='banner3-breadcrumb'>
                <div className='banner3-home'><Link to='/'>Home</Link></div>
                <i className="fa fa-angle-right" />
                <div className='banner3-link'>{}</div>
            </div>

        </div>
    )
}
export default withRouter(NewsBanner);
